import React from 'react'

const titleStyle = {
    fontWeight: "bold"
}

const Header = (props) => {
  if (props.title){
    return (
        <h1 style={titleStyle}>{props.title}</h1>
    )
  }
  return (
    <h1 style={titleStyle}>Header</h1>
  )
}

export default Header
